import React from 'react';

import HomeStyle from './HomeStyle';
import { withStyles } from '@material-ui/core'; // npm install @material-ui/styles
import Button from '@material-ui/core/Button';
import Container from '@material-ui/core/Container';



const Home = () => (
        <>
        <Container style={HomeStyle.containerHome} maxWidth="lg" >
                        <div style={HomeStyle.blockGauche}>
                                <p style={HomeStyle.intro}>Bienvenue ! <br /> Je m'appelle Marie Thielens <br /> et je suis web developer.</p>
                                <p style={HomeStyle.gris}>Front End Developper / React / Wordpress</p>
                                <Button style={HomeStyle.bouton} variant="outlined">Venez voir mon travail</Button> 
                        </div>
                        <div>
                                <img style={HomeStyle.newMarieImage} src="../../img/NewSuperMarie.png" alt="Logo super Marie" />
                        </div>
        </Container>
        </>
)
export default withStyles(HomeStyle)(Home);
